defaultValue.value:
(key, { sortDirection, isSortHeader, sortStates }) => {
  if (key === translationKeys.iconDescription) {
    if (isSortHeader) {
      // When transitioning, we know that the sequence of states is as follows:
      // NONE -> ASC -> DESC -> NONE
      if (sortDirection === sortStates.NONE) {
        return 'Sort rows by this header in ascending order';
      }
      if (sortDirection === sortStates.ASC) {
        return 'Sort rows by this header in descending order';
      }

      return 'Unsort rows by this header';
    }
    return 'Sort rows by this header in ascending order';
  }

  return '';
}

type.raw:
(props, propName, componentName) => {
  if (props[propName] === undefined) {
    return;
  }
  try {
    new RegExp(props[propName]);
  } catch (e) {
    return new Error(
      `Invalid value of prop '${propName}' supplied to '${componentName}', it should be a valid regular expression`
    );
  }
}

defaultValue.value:
item => {
  if (typeof item === 'string') {
    return item;
  }

  return item ? item.label : '';
}

